import React from 'react'

const navBar = () => {
  return (
    <div>

   <nav classname="navbar bg-body-tertiary">
    <div classname="container-fluid">
      <span classname="navbar-brand mb-0 h1">Navbar</span>
    </div>
   </nav>
    </div>
  )
}

export default navBar
